                if (k.toString().indexOf('$') == -1) {
                    if (v.$invalid) {
                        errors.push(v.$error)
                    }
                }
            });

            var valid = form.$valid;
            if (!valid && errors.length) {
                ng.forEach(form.$error, function (errType) {
                    ng.forEach(errType, function (err) {
                        err.$setDirty();
                    });
                });
