(function($){
var cout = 1,//
dom = {}; //DOMjQuery
//bd = $('body'), doc = $(document), win = $(window);
//
$(window).resize(function(){
    setTimeout(function(){
        $.each(dom, function(i, v){
            v[1].css({width: v[0].outerWidth(), height:v[0].outerHeight()});
        });
    }, 0);
});
$.extend($.fn,{
cover: function(os) { //os: options
    //
    var st = {
        bg: '#FFF', //
        opacity: 0,  //
        zIndex: 8888, //z-index
        owndom: document
    };
    if(os){$.extend(st, os);}
    //
    $(st.owndom).bind('empty', function(){
        $.each(dom, function(i, v){
            v[1].remove();
            delete(dom[i]);//
        });
    });
    return this.each(function(){
        var t = $(this);
        var i = t.data('coverIndex');
        if(i && dom[i]){//Cover
            return;
        }
        var o = $('<div></div>');
        o.css({
            position: 'absolute',
            width: t.outerWidth(),
            height: t.outerHeight(),
            overflow: 'hidden',
            background: st.bg,
            opacity: st.opacity,
            zIndex: st.zIndex
        });
        t.before(o);
        dom[cout] = [t, o];
        t.data('coverIndex', cout);
        cout ++;
    });

},
//Cover
uncover: function(){
    return this.each(function(){
        var i = $(this).data('coverIndex');
        if(!i || !dom[i]){return;}
        dom[i][1].remove();
        delete(dom[i]);
    });
}
});

})(jQuery);

