const disjunction = new Intl.ListFormat('en', { type: 'disjunction' });

const formatter = {
  format(iterable, { type }) {
    if (type === 'conjunction') {
      return conjunction.format(iterable);
    }

    return disjunction.format(iterable);
  },
};

